B.abS=A.b(s(["Nanette Streicher, 1769 in Augsburg geboren, starb am 16. Januar 1833 in Wien und wurde auf dem Sankt Marxer Friedhof beigesetzt. Heute ruht sie neben ihrem Mann Johann Andreas Streicher in einem Ehrengrab auf dem Wiener Zentralfriedhof. Hier, auf diesem ehemaligen Friedhof, der heute eine Parkanlage ist, wurden auch Maria Theresia Paradis, Marianne von Martines, Josepha Auernhammer und die S\xe4ngerinnen Anna Gottlieb oder Katharina Waldm\xfcller bestattet.",'Hier stand bis 1920 das Palais des Arztes und Magnetiseurs Franz Anton Mesmer. Der Versuch Mesmers, durch seine Methode des \u201ethierischen Magnetismus\u201c die Blindheit der Maria Theresia Paradis zu heilen, scheiterte. 1768 d\xfcrfte im Palais das Singspiel "Bastien und Bastienne" uraufgef\xfchrt worden sein (von Mesmer in Auftrag gegeben). Wahrscheinlich hier hat der junge Mozart Paradis kennengelernt und ihr darauf hin sein Klavierkonzert KV 556 gewidmet.',"Nanette Stein, verehelichte Streicher, erhielt fr\xfch Klavierunterricht und wurde im Klavierbau unterwiesen. So war sie in der Lage, die Werkstatt ihres Vaters in Augsburg nach seinem Tode zu \xfcbernehmen. Im Jahre 1794 heiratete sie den Musiker und Friedrich-Schiller-Freund Johann Andreas Streicher und \xfcbersiedelte im selben Jahr mit ihm nach Wien. Es gelang es ihr, ihren Betrieb zu einem der bedeutendsten Klavierbauunternehmen der Residenzstadt auszubauen. Zu den Freunden und Kunden des Ehepaars Streicher z\xe4hlte Ludwig van Beethoven, den Nanette Streicher in seinen letzten Lebensjahren umfassend betreute.","Die bekannte Wiener Pianistin Josepha Barbara Auernhammer wuchs hier, in den so genannten Passauer-H\xf6fen, auf und veranstaltete da auch Akademien, wo sie mit Wiener Prominenz auftrat, wie Mozart und van Swieten. Sie lektorierte f\xfcr Mozart Sonaten vor der Drucklegung und ist die Widmungstr\xe4gerin einiger seiner Klavier- und Violinsonaten. Ihr Klavierwerk, Klaviervariationen und Deutsche Lieder, zeugt von ihrer gro\xdfen Virtuosit\xe4t. Sie ist auf dem St. Marxer Friedhof begraben.","Schon als 17-J\xe4hrige trat Marianna von Martines erstmals als Komponistin auf. Eine ihrer Messen wurde in der Wiener Hofkirche St. Michael aufgef\xfchrt. Der einflussreiche Komponist und Musiktheoretiker Padre Giovanni Battista Martini sch\xe4tzte ihre Werke, was bewirkte, dass zwei Klaviersonaten 1760 in einer Anthologie ver\xf6ffentlicht wurden und sie 1773 in die Accademia Filarmonica di Bologna aufgenommen wurde. Martines komponierte zwei Libretti ihres Mentors Pietro Metastasio, ihr ber\xfchmtestes Werk Isacco figura del redentore (Isaak \u2013 Vorbild des Erl\xf6sers), wurde mit gro\xdfem Erfolg durch die 1771 gegr\xfcndete Wiener Tonk\xfcnstler-Soziet\xe4t aufgef\xfchrt.","Die blinde Komponistin, S\xe4ngerin, Pianistin und P\xe4dagogin ist eine der von Kaiserin Maria Theresia gef\xf6rderten Komponistinnen. Ihre Kompositionen \u2013 Lieder, Kammermusik, Klavierkonzerte und Musiktheater \u2013 wurden seit den 1780er Jahren gedruckt. Sie regte zu den ersten Blindenmusikschulen in Europa an, behalf sich selbst mit einem Notensetzbrett und gr\xfcndete 1808 am Rabensteig 8 eine Musikschule f\xfcr blinde M\xe4dchen.","Die Komponistin und Harfenistin war die Lehrerin der Erzherzoginnen am Wiener Hof, das Kaiserhaus finanzierte ihr eine Konzertreise durch Europa. Geboren als Tochter eines Schuhmachers, durfte sie dank der Liebe ihres Vaters zur Musik das Harfenspiel erlernen. Sie wurde auch in das Orchesters des k.u.k. Hoftheaters, neben dem K\xe4rntner Tor, als Harfenistin verpflichtet, die Zeitgenossen, wie Beethoven oder Johann Gottlieb Naumann, komponierten f\xfcr sie. Joseph der II. fungierte als M\xe4zen der Drucklegung ihrer Werke.","Hier wurde Josepha Auernhammer geboren, im sogenannten Baadischen Haus, da es hier im 17. Jahrhundert ein Bad gab. Sp\xe4ter war hier das Restaurant des Ignaz Jahn, wo Mozart sein letztes Konzert am 4. M\xe4rz 1791 gab. Im Archiv der Gesellschaft der Musikfreunde befindet sich ihre handschriftliche Biografie und das Werkverzeichnis er Josepha Auernhammer. Nach ihrer Heirat lebte Josepha Barbara Auernhammer, nun verm\xe4hlte Bessenig, auf der Landstra\xdfe. Sie veranstaltete weiter Hauskonzerte und trat im Burgtheater auf: unter anderem als Solistin bei Beethovens Klavierkonzert Opus 15.","Die Komponistin, Cembalistin, S\xe4ngerin und Konzertorganisatorin genoss als Tochter des p\xe4pstlichen Nuntius in Wien die F\xf6rderung Maria Theresias und des Hofdichters und Librettisten Pietro Metastasio. Die Familie lebte im Haus Metastasios, wo Marianna ihre w\xf6chentlichen Soireen veranstaltete. Martines bekam unter anderem Unterricht von Joseph Haydn, der eine Zeit lang in der Dachstube des Michaelerhauses wohnte.","In der Augustinerkirche hatte die Paradis 1775 mit 16 Jahren ihren Auftritt als S\xe4ngerin in Giovanni Pergolesis liturgischer Komposition \u201eStabat Mater\u201c. Blind seit ihrem 4. Lebensjahr, wurde sie auf dem Fortepiano und auf der Orgel unterrichtet. Sie begeisterte ihre Mitmenschen mit ihrem Talent und ihrer Bildung und unternahm eine ausgedehnte Europatournee. Beeindruckt von ihrer Ged\xe4chtnisleistung setzte ihr die Kaiserin eine Ehrenpension von 200 Gulden aus, der Sohn Joseph sparte sie jedoch ein, dessen Nachfolger Leopold zahlte sie wieder aus.","Nanette und ihr Mann Andreas Streicher waren nicht nur Klavierbauer. Einen wichtigen Beitrag zum Wiener Musikleben bildeten auch die Konzerte, die sie zun\xe4chst in ihrer Wohnung, ab 1812 dann in ihrem etwa 300 G\xe4ste umfassenden Klaviersalon veranstalteten und damit jungen K\xfcnstlerinnen und K\xfcnstlern willkommene Auftrittsm\xf6glichkeiten boten. Noch fehlte in Wien eine gro\xdfe Konzertinstitution, das Ehepaar Streicher geh\xf6rt zu den Gr\xfcndungsmitgliedern der Gesellschaft der Musikfreunde in Wien.","Die in Guntramsdorf geborene Leopoldine Blahetka war ein pianistisches Wunderkind, die Klavier und Komposition bei Ignaz Moscheles, Katharina Cibbini und Simon Sechter studierte. Beethoven sch\xe4tzte und f\xf6rderte sie, Robert Schumann war von ihrer Spielweise wie von ihren Kompositionen beeindruckt.  Leopoldine Blahetka komponierte eine Oper und ging bis zu ihrem fr\xfchen Tod in Boulogne-sur-Mer auf Konzertreisen."]),t.s)
